func TestCallContract_LocalCreateYCCEVMTx(t *testing.T) {
	type fields struct {
		ContractAddr string
		ParaName     string
		Abi          string
	}
	type args struct {
		parameter string
	}
	var tests = []struct {
		name    string
		fields  fields
		args    args
		want    *chainTypes.Transaction
		wantErr bool
	}{
		{
			"1",
			fields{
				ContractAddr: test_contract_addr0,
				ParaName:     test_paraName1,
				Abi:          test_abi,
			},
			args{
				parameter: fmt.Sprintf("mint(%q,%v,%q)", test_managerAddress, 1, "http://www.163.com"),
			},
			nil,
			false,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			c := &CallContract{
				ContractAddr: tt.fields.ContractAddr,
				ParaName:     tt.fields.ParaName,
				Abi:          tt.fields.Abi,
			}
			got, err := c.LocalCreateUnSignYCCEVMTx(tt.args.parameter)
			if (err != nil) != tt.wantErr {
				t.Errorf("LocalCreateYCCEVMTx() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			t.Logf("result:%v", got.JSON())
		})
	}
}
